import { Link } from 'react-router-dom';

function Home() {
  return (
    <div style={{ textAlign: 'center', padding: '2rem' }}>
      <h1>Automatic Report Generator</h1>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        <li><Link to="/energy-analysis" style={{ display: 'block', margin: '1rem', padding: '0.5rem', border: '1px solid #007bff', textDecoration: 'none', color: '#007bff' }}>Energy Data Analysis</Link></li>
        <li><Link to="/stock-analysis" style={{ display: 'block', margin: '1rem', padding: '0.5rem', border: '1px solid #007bff', textDecoration: 'none', color: '#007bff' }}>Stock Data Analysis</Link></li>
        <li><Link to="/attendance-analysis" style={{ display: 'block', margin: '1rem', padding: '0.5rem', border: '1px solid #007bff', textDecoration: 'none', color: '#007bff' }}>School Attendance Analysis</Link></li>
      </ul>
    </div>
  );
}

export default Home;
